import truncateHash from 'utils/truncateHash'
import useAuth from 'hooks/useAuth'
import { SlideSvgDark, SlideSvgLight } from './SlideSvg'
import CompositeImage, { getSrcSet, CompositeImageProps } from './CompositeImage'


const IntroBackground = styled.div`
  background-image: url(/images/home/home-intro.png);
  height: calc(100vw * 1.1);
  background-repeat: no-repeat;
  background-size: cover;
`

const HeaderSection = styled.div`

`
const MainLogoSection = styled.div`

`

const Hero = () => {
  const { t } = useTranslation()
  const { account } = useWeb3React()
  const { theme } = useTheme()
  const { logout } = useAuth()
  // console.log('account', account)
  const truncatedAddress = account ? truncateHash(account) : ''
  
  return (
    <IntroBackground>
      <HeaderSection>
        <Flex
          flexDirection="row"
          justifyContent="center"
          alignItems="center"
          maxWidth={1200}
          alignSelf="center"
          margin="auto"
          pt={24}
        >
          <Flex flex={1} height={72}>
            <LogoSvg />
          </Flex>
          <Flex flex={1} flexDirection="row" justifyContent="center" alignItems="center">
            <Flex flex={1} justifyContent="center" alignItems="center">
              <img src="/images/home/menu/marketplace.png" alt="Marketplace" />
            </Flex>
            <Flex flex={1} justifyContent="center" alignItems="center">
              <img src="/images/home/menu/Staking.png" alt="Staking" />
            </Flex>
            <Flex flex={1} justifyContent="center" alignItems="center">
              <img src="/images/home/menu/Whitepaper.png" alt="Whitepaper" />
            </Flex>
            <Flex flex={1} justifyContent="center" alignItems="center">
              <img src="/images/home/menu/play-now.png" alt="Play now" />
            </Flex>
            <Flex flex={1} justifyContent="center" alignItems="center">
              {!account ? (
                <ConnectWalletButton scale="sm" />
              ) : (
                <Button onClick={logout} scale="sm">
                  {truncatedAddress}
                </Button>
              )}
            </Flex>
          </Flex>
        </Flex>
      </HeaderSection>
      <MainLogoSection>
        <Flex justifyContent='center'>
          <img src="/images/home/phoenix.png" width={560} alt='Phoenix'/>
        </Flex>
        <Flex justifyContent='center'>
          <img src="/images/home/game-name.png" width={1000} alt='Monster'/>
        </Flex>
      </MainLogoSection>
    </IntroBackground>
  )
}

export default Hero

